// -------------------- Import --------------------
import React from "react";
// import like from "../../Assets/Icons/like2.png";
import like from "../../Assets/Icons/icons8-love-48.png";
// import like from "../../Assets/Icons/icons8-heart-50.png";

// -------------------- Row Table List --------------------
export default function RowTable(props) {
  // sittings
  const category_data = props.category_data,
    points_name = props.points_name;

  return (
    <li>
      <div className="row_list">
        <span>{category_data.PLAYER_NAME || category_data.TEAM_CITY}</span>
        <span>{category_data[points_name]}</span>
        <img id="like" src={like} alt="" />
      </div>
    </li>
  );
}
